// src/components/PatientTemplateDetail.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams, Link } from 'react-router-dom';
import '../styles/routineTemplates.css';
import './patientTemplates.css';

/** Decodifica un JWT y devuelve su payload como objeto, o null si falla */
function decodeJwt(token) {
  try {
    const b64Url = token.split('.')[1];
    const b64    = b64Url.replace(/-/g, '+').replace(/_/g, '/');
    const json   = atob(b64);
    return JSON.parse(json);
  } catch {
    return null;
  }
}

/** Extrae el patientId del payload del JWT o de localStorage.userId */
function getPatientId() {
  const raw = localStorage.getItem('token');
  if (!raw) return null;
  const token = raw.startsWith('Bearer ') ? raw.slice(7) : raw;
  const payload = decodeJwt(token);
  if (payload) return payload.id || payload.sub || payload.user?.id || null;
  return localStorage.getItem('userId');
}

export default function PatientTemplateDetail() {
  const { instanceId } = useParams();
  const [instance, setInstance] = useState(null);
  const [loading, setLoading]   = useState(true);
  const [error, setError]       = useState(null);

  useEffect(() => {
    const fetchDetail = async () => {
      const token     = localStorage.getItem('token');
      const patientId = getPatientId();
      if (!token || !patientId) {
        setError('No estás autenticado. Por favor, inicia sesión.');
        setLoading(false);
        return;
      }

      try {
        // traemos todas las instancias y filtramos por instanceId
        const res = await axios.get(
          `/api/routines/instances/${patientId}`,
          { headers: { 'x-auth-token': token } }
        );
        const list = Array.isArray(res.data)
          ? res.data
          : Array.isArray(res.data.instances)
            ? res.data.instances
            : [];
        const found = list.find(i => i._id === instanceId);
        if (!found) {
          setError('No se encontró la plantilla solicitada.');
        } else {
          setInstance(found);
        }
      } catch (err) {
        console.error(err);
        setError(err.response?.data?.msg || 'Error al cargar detalles');
      } finally {
        setLoading(false);
      }
    };

    fetchDetail();
  }, [instanceId]);

  const toggleActivity = async idx => {
    const token = localStorage.getItem('token');
    if (!token || !instance) return;

    const was = instance.completedActivities.includes(idx);
    try {
      await axios.post(
        `/api/routines/instances/${instanceId}/activities/${idx}`,
        { completed: !was },
        { headers: { 'x-auth-token': token } }
      );
      setInstance(inst => ({
        ...inst,
        completedActivities: was
          ? inst.completedActivities.filter(i => i !== idx)
          : [...inst.completedActivities, idx]
      }));
    } catch (err) {
      console.error(err);
      setError('No se pudo actualizar la actividad.');
    }
  };

  if (loading) return <p>Cargando detalles…</p>;
  if (error)   return <p className="error-msg">{error}</p>;

  const tpl = instance.template;

  return (
    <div className="routine-templates-page patient-templates-page tpl-detail-page">
      <div className="tpl-container">
        <div className="detail-header">
          <Link to="/patient/templates" className="back-link">
            ← Volver
          </Link>
          <h1>{tpl.name}</h1>
        </div>

        <p className="tpl-desc">{tpl.description}</p>

        <div className="tpl-meta">
          <span>Asignado el: {new Date(instance.createdAt).toLocaleDateString()}</span>
          <span>Duración total: {tpl.duration} min</span>
          <span>Tags: {tpl.tags?.join(', ')}</span>
        </div>

        <div
          className="challenge-indicator"
          data-level={tpl.challengeLevel}
        >
          Nivel de reto: {tpl.challengeLevel}
        </div>

        <h2 className="activities-title">Actividades</h2>
        <ul className="tpl-activities-list">
          {tpl.activities.map((act, i) => {
            const completed = instance.completedActivities.includes(i);
            return (
              <li key={i} className="activity-item">
                <div className="activity-main">
                  <label>
                    <input
                      type="checkbox"
                      checked={completed}
                      onChange={() => toggleActivity(i)}
                    />
                    <span className={completed ? 'completed' : ''}>
                      {act.name} &mdash; Nivel {act.challenge} &mdash; {act.minutes} min
                    </span>
                  </label>
                  <span className="activity-idx">#{i + 1}</span>
                </div>
                {act.desc && (
                  <p className="activity-desc">{act.desc}</p>
                )}
              </li>
            );
          })}
        </ul>
      </div>
    </div>
  );
}
